import Button from 'react-bootstrap/Button';
import ProductDetail from '../components/ProductDetail.js'
const MensList = ({genderMens}) => {
  const [selectedGenderMen, setselectedGenderMen] = useState(null);


    const mensItems = genderMens.map((genderMen, index) => {
      return <Button variant="light" onClick = {() => onItemsClick(genderMen) }>Hello</Button>

    })

        const onItemsClick = function(genderMen){
        setselectedGenderMen(genderMen);
    }

    const onBackButton = function () {
      setselectedGenderMen(null);
    }


  if (selectedGenderMen) {
    return (

      <div>
      <ul>
        <HotelDetail region={selectedGenderMen}/>
        <button Class = "button_2" onClick={() => onBackButton()}>Choose another Region</button>
      </ul>
    </div>
    );

  } else if (!selectedGenderMen) {
    return (      
    <div>
    <ul>
      {mensItems}
    </ul>
  </div>

    )}
};

export default MensList;
